import { getConnections } from "./../database/database";

const getLanguages = async (req, res) => {
  const connection = await getConnections();
  const result = await connection.query("SELECT * FOM usuarios");
  console.log(result);
  res.json(result);
};

export const methods = {
  getLanguages,
};

